import React from "react";
import "../../assets/css/missionVision.css";
import "assets/vendor/font-awesome/css/font-awesome.min.css";
import q1 from "../../assets/img/theme/missionVision/quotes-1.jpg";
import q2 from "../../assets/img/theme/missionVision/quotes-2.jpg";

import {
    Button,
    FormGroup,
    Input,
    Container,
    Row,
    Col
  } from "reactstrap";

class MissionVision extends React.Component {
    state = {};
    componentDidMount() {
        document.documentElement.scrollTop = 0;
        document.scrollingElement.scrollTop = 0;
        this.refs.main.scrollTop = 0;
    }
    render() {
        return (
            <>       
                <main ref="main">
                    <div id="fh5co-reviews-outer" classnames="fh5co-reviews-outer container-fluid">
                        <Container>
                            <h1>ACERCA DE NOSOTROS</h1>
                            <div id="fh5co-reviews-inner">
                                <Row classnames="justify-content-center">
                                    <Col sm="6" classnames="wow fadeIn animated" data-wow-delay="0.25s">
                                        <h2>Misión</h2>
                                        <br/>
                                        <img className="float-left" src={q1}/>
                                        <p id="testimonial-desc">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Quis similique quasi.</p>
                                        <img className="float-right" src={q2}/>
                                    </Col>
                                    <Col sm="6" id="testimonial-2" classnames="wow fadeIn animated" data-wow-delay="0.67s">
                                        <h2>Visión</h2>
                                        <br/>
                                        <img className="float-left" src={q1}/>
                                        <p id="testimonial-desc">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Quis similique quasi.</p>
                                        <img className="float-right" src={q2}/>
                                    </Col>
                                </Row>
                                {/* <div className="row justify-content-center">
                                    <div className="col-sm-5 wow fadeIn animated" data-wow-delay="0.25s">
                                        <h2>Misión</h2>
                                        <br/>
                                        <img className="float-left" src={q1} alt="Quote 1"/>
                                        <p className="testimonial-desc">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Quis similique quasi.</p>
                                        <img className="float-right" src={q2} alt="Quote 2"/>
                                    </div>
                                    <div className="col-sm-5 testimonial-2 wow fadeIn animated" data-wow-delay="0.67s">
                                        <h2>Visión</h2>
                                        <br/>
                                        <img className="float-left" src={q1} alt="Quote 1"/>
                                        <p className="testimonial-desc">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Quis similique quasi.</p>
                                        <img className="float-right" src={q2}alt="Quote 2"/>
                                    </div>
                                </div> */}
                            </div>
                        </Container>                   
                    </div>
                </main>    
            </>
        );
    }
}

export default MissionVision;
